import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img
          className="home__image"
          src="https://www.junehomesupply.com/wp-content/uploads/2020/01/TURKISH-TOWEL-CLEMENTINE.jpg"
          alt=""
        />

        <div className="home__row">
          <Product
            id="123456"
            title="100% Cotton Navy Pestemal vith white lining (Pack of 6)"
            price={99.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={3}
          />
          <Product
            id="2345678"
            title="100% Cotton White Pestemal vith turquoise lining (Pack of 6)"
            price={99.99}
            image="https://i.pinimg.com/564x/4f/0b/3c/4f0b3ce1fda2f83fd16fb77f81e74fa7.jpg"
            rating={5}
          />
        </div>

        <div className="home__row">
          <Product
            id="2345678"
            title="Navy Pestemal Turkish Towel (Pack of 6)"
            price={99.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={3}
          />
          <Product
            id="2345678"
            title="Navy Pestemal Turkish Towel (Pack of 6)"
            price={99.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={3}
          />
          <Product />
        </div>

        <div className="home__row">
          <Product />
        </div>
      </div>
    </div>
  );
}

export default Home;
